import React from "react"
import './style.css';

function Header() {
  return (
    <header id="top">
      <a href="https://ibb.co/YQ2hjJX">
        <img src="https://i.ibb.co/H47qgRC/header-photo.jpg" alt="header-photo"/>
        </a>
      <p>Ali Naqvi</p>
    </header>

  );
}

export default Header;
